    const [submitted, setSubmit] = useState(false)
    const [error, setMessange] = useState(false)

        return(
            <div className="login">
                <h1>Please Log In</h1>
            <form>
                <label>
                    <p>Email</p>
                    <input type="text"/>
                </label>
                <label>
                    <p>Password</p>
                    <input type="text"/>
                </label>
                <div>
                    <button type="submit">Submit</button>
                </div>
            </form>
            </div>
        )

}
